I’m honored to be taking part in such a meaningful event with a great cause. 

AzizProjects presents Inside Out: a fundraiser exhibition & silent auction exploring the interplay between personal healing and the collective well-being of community. 

This exhibition is hosted by @Aziz.Gallerie and geared to raise funds for AzizProjects’ artist collective, opening October 2023 on Crenshaw Blvd. A portion of all proceeds made during the exhibition will support bringing workshops, artist residencies, kids art classes and more to the community.

Opening Reception: September 16th 5-9PM visit azizgallerie.com to learn more.

